'use strict'

function generateDifficultToSolveProblems(difficulty, number, numberOfFixedSlots = 3){
    let r = []
    let i = 0
    const MAX_ITERATION = 1000
    while(r.length < number && i < MAX_ITERATION){
        const fixedSchedule = (numberOfFixedSlots <= 0) ? new Schedule() : generateRandomSchedule(numberOfFixedSlots);
        const slotlist = generateSlotlist(difficulty, fixedSchedule)

        if (checkMajorConstraints(greedySolve(slotlist, fixedSchedule).value) > checkMajorConstraints(exactSolver(slotlist, fixedSchedule).value)){
            r.push({
                slotlist: slotlist,
                fixedSchedule: fixedSchedule.copy()
            })
            console.log(r.length, `${i/MAX_ITERATION * 100}%`)
        }
        i++
    }
    console.log('number of iterations: ', i)
    return r;
}

function getDifficultToSolveProblem(difficulty){
    const list = function(){
        switch(difficulty){
            case 'easy':
                return getListOfDifficultToSolveEasyProblems();
            case 'medium':
                return getListOfDifficultToSolveMediumProblems();
            case 'hard':
                return getListOfDifficultToSolveHardProblems();
            case 'story':
                return getListOfDifficultToSolveStoryProblems();
            default:
                break;
        }
    }()

    const newRoomOrder = function(){
        let r = []
        let options = [1, 2, 3, 4]
        function helper(list, r = []){
            if (list.length === 0){
                return r;
            }
            const random = Math.floor(Math.random() * list.length)
            r.push(list[random])
            const newList = list.filter((value) => {return value !== list[random]})
            return helper(newList, r)
        }
        return helper(options, r)
    }()

    
    const pickAListItemAndShuffleRooms = function (){
        const random = Math.floor(Math.random() * list.length)
        let r = list[random]
        Object.keys(r.fixedSchedule.value).forEach((name) =>{
            r.fixedSchedule.value[name].room = newRoomOrder[r.fixedSchedule.value[name].room -1]
        })
        return r;
    }()

    return pickAListItemAndShuffleRooms;
}


function generateEasyToSolveProblemsByGreedyApproach(difficulty, numberOfFixedSlots, number){
    let r = []
    while(r.length < number){
        const fixedSchedule = (numberOfFixedSlots === 0) ? new Schedule() : generateRandomSchedule(numberOfFixedSlots);
        const slotlist = generateSlotlist(difficulty, fixedSchedule)

        if (checkMajorConstraints(greedySolve(slotlist, fixedSchedule).value) === checkMajorConstraints(exactSolver(slotlist, fixedSchedule).value)){
            r.push({
                slotlist: slotlist,
                fixedSchedule: fixedSchedule.copy()
            })
            console.log(r.length)
        }
    }
    return r;
}


